import React from 'react';
import maintenance from '../assets/maintenance.jpg';
import UserList from '../components/UserList';

const HomePage = () => {
  return (
    <div className='container'>
      <div className='row'>
        <div className='col-md-6 col-sm-12 mb-4 mb-md-0'>
          <img className='img-fluid rounded mx-auto d-block' src={maintenance} alt='Maintenance' />
        </div>
        <div className='col-md-3 col-sm-12 mt-2' style={{ position: 'fixed', top: '0', right: '0' }}>
          <UserList />
        </div>
      </div>
    </div>
  );
};

export default HomePage;
